@Component({
  selector: 'app-root',
  templateUrl: './app.component.html'
})
export class AppComponent {
  title = 'app';
}
<body>
  <app-nav-menu></app-nav-menu>
  <main class="container">
    <router-outlet></router-outlet>
    <div class="card" style="width: 400px; text-align: center; margin: auto;">
      <img class="img" src="../assets/imgs/periquito.jpg" class="card-img-top">
      <div class="card-body">
        <h5 class="card-title">Samuel Sanchez Arroyo</h5>
        <p class="card-text">Aqui dejo mi linkedin por si quereis echarle un vistazo</p>
        <a href="#" class="btn btn-primary">Linkedin</a>
      </div>
    </div>
  </main>
  
</body>
